// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "../structs/FoodTypes.sol";
import "../access/RoleAccess.sol";
import "../interfaces/IReviewManager.sol";
import "../interfaces/IRestaurantManager.sol";

contract ReviewManager is OwnableUpgradeable, RoleAccess, IReviewManager {
    mapping(uint128 => Review[]) public restaurantReviews;

    event RestaurantRated(uint128 indexed restaurantId, address indexed customer, uint8 rating, string comment);

    modifier onlyFoodApp() {
        require(msg.sender == foodApp, "Only FoodApp can call");
        _;
    }

    function initialize(address _foodApp) public initializer {
        require(_foodApp != address(0), "Invalid FoodApp address");
        __Ownable_init(_foodApp);
        initializeRoles(_foodApp);
    }

    function rateRestaurant(
        address caller,
        uint128 restaurantId,
        uint8 rating,
        string memory comment
    ) external override onlyFoodApp {
        require(roles[caller] == Role.Customer, "Only customer");
        require(IRestaurantManager(foodApp).restaurantExists(restaurantId), "Invalid restaurantId");
        require(rating >= 1 && rating <= 5, "Rating must be 1-5");

        restaurantReviews[restaurantId].push(Review({
            customer: caller,
            restaurantId: restaurantId,
            rating: rating,
            comment: comment,
            timestamp: uint128(block.timestamp)
        }));

        emit RestaurantRated(restaurantId, caller, rating, comment);
    }

    function getReviews(uint128 restaurantId) external view override returns (Review[] memory) {
        return restaurantReviews[restaurantId];
    }
}

