// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

contract RoleAccess {
    enum Role { None, Admin, Customer, FOH, BOH }

    mapping(address => Role) public roles;
    mapping(address => uint128) public staffRestaurants;

    address public foodApp;

    modifier onlyAdmin() {
        require(roles[msg.sender] == Role.Admin, "Only admin");
        _;
    }

    modifier onlyCustomer() {
        require(roles[msg.sender] == Role.Customer || roles[msg.sender] == Role.FOH || roles[msg.sender] == Role.BOH || roles[msg.sender] == Role.Admin, "Only customer or staff");
        _;
    }

    modifier onlyStaff(uint128 restaurantId) {
        require((roles[msg.sender] == Role.FOH || roles[msg.sender] == Role.BOH) && staffRestaurants[msg.sender] == restaurantId, "Only staff of restaurant");
        _;
    }

    function initializeRoles(address _foodApp) internal {
        foodApp = _foodApp;
        roles[_foodApp] = Role.Admin;
    }

    function addMeAsCustomer() external {
        require(roles[msg.sender] == Role.None, "Role already assigned");
        roles[msg.sender] = Role.Customer;
    }

    function addStaff(address staff, Role role, uint128 restaurantId) external {
        require(msg.sender == foodApp, "Only FoodApp");
        require(role == Role.FOH || role == Role.BOH, "Invalid staff role");
        require(roles[staff] == Role.None, "Role already assigned");
        roles[staff] = role;
        staffRestaurants[staff] = restaurantId;
    }
}

